function model_excmap_bank(table, ref) {

	this.bank = {};
	this.table = table;
	this.ref   = ref;
}

model_excmap_bank.prototype.reset = function() {

	this.bank = {};
}

model_excmap_bank.prototype.get = function(block, leaf, data, offset) {

	var ref = this.ref;
	var v = data[offset + ref];
	if (v == null) /* null or undefined ? */
		v = block[ref].init;
	if (0 <= v && v < this.table.length) {
		var prm = this.table[v];
		if (leaf.pos < prm.leaf.length) {
			return { desc: prm.desc, leaf: prm.leaf[leaf.pos] };
		}
	}
	return null;
}

model_excmap_bank.prototype.put = function(o, v, data) {
	console.log(o, v);
	if (v < 0 || v >= this.table.length)
		return;

	var prm = this.table[v];

	var save = o.value;
	var load = v;
	var id = o.bid + '-' + o.leaf.id;

	if (this.bank[id] === undefined) this.bank[id] = [];
	if (this.bank[id][save] === undefined) this.bank[id][save] = [];
	if (this.bank[id][load] === undefined) this.bank[id][load] = [];

	var dt1 = [];
	var from = -1;

	for (var i = o.index + 1, num = o.block.length, x = 0, stop = false; i < num; i++) {
		if ('pos' in o.block[i]) {
			if (!stop) from = i;

			/* save data */
			this.bank[id][save][x] = data[o.offset + i];

			/* restore data */
			v = this.bank[id][load][x];
			if (x < prm.leaf.length) {
				if (v == null) /* null or undefined ? */
					v = prm.leaf[x].init;
				globals.model.make_dt1_data(v, o.block[i].bytes, dt1);
			}
			data[o.offset + i] = v;

			x++; stop = true;
			globals.observer.notify('model', o.bid + '-' + o.block[i].id);
		} else if (stop) {
			break;
		}
	}

	if (from >= 0) {
		id = o.bid + '-' + o.block[from].id;
		var addr = eval(id.replace(/-/g, '+'));
		globals.communicator.dt1(addr, dt1);
	}

}
